import logo from './logo.svg';
import './App.css';
import headerImg from "./images/extch.png";
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

function Header() {
  return (
    <>
      <img class='img' src={headerImg} alt="ExTech logo"></img>
      <div>
        <h1>Exemplify tech. Job searching. Simplified.</h1>
        <h3>With the company roles, dates, and apply links, we strive to simplify the job searching & filtering process, catered towards your needs.</h3>
      </div>
    </>
  );
}

export default hEADER;
